Kafo estas trinkaĵo preparata el la semoj de kafarbo (ĉefe Coffea arabica kaj Coffea canephora) kaj estas stimula pro enhavo de la kemiaĵo kafeino. La frukto de la kafarbo estas beroforma, nuksa, kun 2 semoj, nomitaj kafofaboj pro ĝiaj formoj. La kafofabojn oni vendas krude aŭ bruligite (rostite). Kafotrinkaĵo estas preparita laŭ tre diversaj manieroj, inter kiuj la plej konataj estas: 
* la plej malnova metodo, iam nomita greka aŭ turka kafo (boligi la pulvorigitajn semojn en akvo); 
* filtrado (pasigi varman akvon tra filtro kun la muelitaj semoj); 
* espreso-metodo (ankaŭ pasigi varman akvon tra filtro sed kun helpo de vapor-premo). Oni kutime trinkas la kafon varman, sed ankaŭ oni povas trinki ĝin malvarman, solan, kun varma lakto, aŭ miksitan kun aliaj spicoj kiel cinamo aŭ cikorio, aŭ kun ĉokolado. La termino kafo estas ankaŭ uzata kun la signifo kafofabo, la semo de kafarbo.
